func minimumSize(nums []int, maxOperations int) int {
	sum := 0
	n := len(nums)
	ceiling := 0
	for _, v := range nums {
		sum += v
		ceiling = max(ceiling, v)
	}

	floor := sum / (n + maxOperations)

	if floor == 0 {
		floor = 1
	}
	var h int
	for floor < ceiling {
		h = (floor + ceiling) / 2
		var ops int
		for i := 0; i < n; i++ {
			ops += (nums[i] - 1) / h
		}

		if ops <= maxOperations || h == 0 {
			ceiling = h
			// return floor
		} else {
			floor = h + 1
		}

	}

	return floor
}

func minimumSizeLeetCode(nums []int, maxOperations int) int {
	max := 0
	for _, x := range nums {
		if x > max {
			max = x
		}
	}
	return sort.Search(max, func(y int) bool {
		if y == 0 {
			return false
		}
		ops := 0
		for _, x := range nums {
			ops += (x - 1) / y
		}
		return ops <= maxOperations
	})
}

